/**
 * Get card stats by card name or code
 */
export function getCardStats(cardNameOrCode) {
  // Try direct lookup
  if (cardStats[cardNameOrCode]) {
    return cardStats[cardNameOrCode];
  }
  
  // Try extracting code from brackets [CODE]
  const match = cardNameOrCode.match(/\[([A-Z0-9-]+)\]/);
  if (match && cardStats[match[1]]) {
    return cardStats[match[1]];
  }
  
  // Default stats
  console.warn(`Card stats not found for: ${cardNameOrCode}`);
  return { atk: 2, def: 2 };
}
